import { Button, Typography } from '@mui/material';
import { Box } from '@mui/system';
import React from 'react';

import { useTheme } from "@mui/material/styles";

const EmailConfirmSuccess = () => {
    const theme = useTheme();
    const primaryColor = theme.palette.primary.main;
  return (
    <Box
    sx={{
        display: 'flex',
        flexDirection:'column',
        alignItems: 'center',

    }}>
        <Box
        component='img'
        src = './success.svg'
        width = '250px'
        height = '250px'
        mb='40px'  
        />
        <Typography color='primary' fontWeight={500} fontSize="24px">
            Email Confirmation Success
        </Typography>
        <Typography color='grey2' fontWeight={400} fontSize="16px">
        Congratulations! your email has already used.
        </Typography>
        <Button
        variant="contained"
        color="secondary"
        sx={{
            width: '133px',
            height: '50px',
            borderRadius: '6px',
            marginTop: '40px',
            color: primaryColor
        }}>
            Login Here
        </Button>



    </Box>
  )
}

export default EmailConfirmSuccess
